import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    // Redirect,
    useRouteMatch,
    // useParams,
  } from "react-router-dom";

import mppNavStyles from "./../../styles/mppNav/mppNav.scss"
// import MppHomePage from "./mppSections/mppHomePage";
// import MppAboutPage from "./mppSections/mppHomePage";
// import MppMedicarePages from "./mppSections/mppMedicarePages";
import MppPage from "./mppPage";

  const MppNav = () => {

    let {path, url} = useRouteMatch();

    return (
      <Router>
        <div>
          <div className={mppNavStyles}>
            <nav>
              <ul className="nav-items">
                <li className="nav-item">
                <Link to= {`${url}/mppHomePage`}>HOME PAGE</Link>
                </li>
                <li className="nav-item">
                  <Link to= {`${url}/mppMedicarePages`}>MEDICARE PAGES</Link>
                </li>

                <li className="nav-item">
                  <Link to= {`${url}/mppAboutPage`}>
                    ABOUT PAGE
                  </Link>
                </li>
              </ul>


            </nav>

            <Switch>


              <Route path= {`${path}/:mppHomePage"`} component={MppHomePage} />
              <Route path= {`${path}/:mppAboutPage"`}  component={MppAboutPage} />
              <Route path={`${path}/:mppMedicarePages"`} component={MppMedicarePages} />

            <Route exact path = {path}>hi</Route>
            <Route path= {`${path}/:mppPageId`}>
                <MppPage/>
            </Route>


            </Switch>
          </div>
        </div>
      </Router>
    );
  };

  export default MppNav;
